// src/App.js

import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    // Función para obtener datos de usuarios del backend
    const fetchUsers = async () => {
      try {
        const response = await axios.get('http://localhost:3000/users'); // Reemplaza la URL con la ruta correcta de tu backend
        setUsers(response.data); // Almacena los datos de usuarios en el estado
      } catch (error) {
        console.error('Error fetching users:', error);
      }
    };

    // Llama a la función para obtener datos de usuarios cuando el componente se monta
    fetchUsers();
  }, []); // Se pasa un arreglo vacío como segundo argumento para que esta función solo se ejecute una vez

  return (
    <div>
      <h1>Lista de Usuarios</h1>
      <ul>
        {users.map(user => (
          <li key={user.id}>{user.name}</li> // Suponiendo que cada usuario tiene un atributo "id" y "name"
        ))}
      </ul>
    </div>
  );
}

export default App;
